  return (
    <>
      <div className="container">
        <div className="box">
          <div className="inputData">
            <input
              type="search"
              className="inputField"
              onChange={(event) => {}}
            />
          </div>

          <div className="info">
            <h2 className="location">
              <i class="fa-solid fa-street-view"></i>
              {city}
            </h2>
            <h1 className="temp">5.25℃el</h1>
            <h3 className="tempmin_max"> Min : 5.25℃el | Max : 5.25℃el</h3>
          </div>
        </div>
      </div>
    </>
  );
};

export default Tempapp;
